Een hangbrug is een brug die is opgebouwd uit twee (soms één) hoge pijlers of pylonen waartussen een dikke kabel gespannen is. Aan deze dikke kabel worden enkele dunnere kabels gehangen om de weg te dragen en horizontaal te houden. Door de symmetrie worden de pijlers hoofdzakelijk verticaal belast. Dit laat toe die pijlers uit te voeren als een lichte betonconstructie. Daartussen hangt een 'hoofd'draagkabel, volgens een kettinglijn – een kromme die lijkt op een parabool. Aan de hoofddraagkabel hangen op regelmatige afstand van elkaar de verticale kabels – 'hangers' genoemd – waaraan het brugdek is opgehangen. In tegenstelling tot de meeste andere brugtypes is dit brugdek zeer licht en buigslap uitgevoerd. Hierdoor blijft de brug betaalbaar. Nadelen hiervan zijn de gevoeligheid voor eigentrillingen en aerodynamische effecten (waardoor de hangbrug bij storm soms wordt afgesloten) en de gevoeligheid voor bewegende geconcentreerde belastingen zoals veroorzaakt door een trein. In de hoofddraagkabel treden zeer grote trekkrachten op. De combinatie hiervan met de grote werkingsarm aan het begin en einde verklaart hoe de brug de krachten (en momenten) van de zeer lange brugdekken kan opnemen. Aan het begin en einde van de brug is de kabel verankerd in de fundering. De kabels zitten daar nagenoeg horizontaal bevestigd, waardoor de grootste krachten op de fundering niet verticaal, maar horizontaal gericht zijn. Dat is ook de reden dat in de Benelux, en bij uitbreiding in Europa, vrijwel geen hangbruggen voorkomen; de bodem is doorgaans te slap om deze grote horizontale krachten te kunnen opvangen. Wanneer de ondergrond bestaat uit rotsen zijn de horizontale krachten wel goed op te nemen. Met dit type brug is het mogelijk zeer grote overspanningen te overbruggen. De langste bruggen ter de wereld met overspanningen van meerdere kilometers zijn hangbruggen: de Akashi-Kaikyo-brug in Japan overspant bijna 2000 m. Het principe van de hangbrug is enigszins vergelijkbaar met een boogbrug hoewel de boog uiteraard gespiegeld is ten opzichte van de horizontale en er in de boog geen trek maar druk optreedt en de spatkrachten naar buiten gericht zijn. De spatkrachten bij een boogbrug kunnen worden opgenomen door trekbalken onder het brugdek. Enkele bekende hangbruggen zijn: 
*  Golden Gate-brug in San Francisco; 
*  Grote Beltbrug in Denemarken; 
*  Brooklyn Bridge in New York; 
*  Akashi-Kaikyo-brug bij Kobe in Japan (in 2006 de grootste overspanning ter wereld met 1991 meter); 
*  Ambassadorbrug tussen Detroit en Windsor, de drukste internationale grensovergang in Noord-Amerika; 
*  De Rijnbrug bij Emmerik in Duitsland is de langste hangbrug van Duitsland. 
*  Tsing Ma Brug in Hongkong verbindt Launtau eiland met het vasteland. Een hangbrug moet niet worden verward met een tuibrug of een zweefbrug.
